import React from 'react';
import ReactDOM from 'react-dom/client';
import { Provider } from 'react-redux'; // הוסף את ה-import הזה
import { configureStore } from '@reduxjs/toolkit'; // הוסף את ה-import הזה
import AdministratorReducer from './path/to/your/AdministratorSlice'; // עדכן את הנתיב
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import AdministratorSlice from './Store/AdministratorSlice';

const myStore = configureStore({
  reducer: {
    AdministratorSlice
  },
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Provider store={myStore}> {/* עטוף את ה-App ב-Provider */}
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
